    heatmapLayer.setData(data);

    var marker;
    function onMapClick(e) {
        var a = e.latlng.toString().split("(");
        var b = a[1].split(")");
        var c = b[0].split(", ");
        var lat = c[0]; var lon = c[1];
        if(marker){
            mymap.removeLayer(marker);
        }
        $.ajax({
            url:DT,
            method:"GET",
            data:{lat: lat, lon: lon,
            },
            beforeSend:function()
            {
                marker = L.marker([lat, lon]).addTo(mymap);
                marker.bindPopup("<img src=\"/assets/loading.gif\" width=\"50px;\"> <span style=\"display: inline-block;\">Loading data...</span>").openPopup();
            },
            success:function(data, status)
            {
                var data=JSON.parse(data);
                mymap.removeLayer(marker);
                marker = L.marker([lat, lon]).addTo(mymap);
                marker.bindPopup("lat: "+lat+"<br>lon: "+lon+"<br>N: "+data['N']).openPopup();

                document.getElementById('lat').value = lat;
                document.getElementById('lon').value = lon;
                document.getElementById('N').value = data['N'];
            }
        });
    }

