    var min_lat = 100, max_lat = -100, min_lon = 200, max_lon = -200;
    var dotting, latlng;
    function plotme(lat, lon){
        if(isNaN(lat) == false && isNaN(lon) == false){
            if(lat > -90 && lat < 90 && lon > -180 && lon < 180){
                if(lat < min_lat){
                    min_lat = lat;
                }
                if(lat > max_lat){
                    max_lat = lat;
                }
                if(lon < min_lon){
                    min_lon = lon;
                }
                if(lon > max_lon){
                    max_lon = lon;
                }
                $('#result').empty();
                var markerOpt = {
                    radius: 4,
                    fillColor: "#7712a6",
                    color: "#000",
                    weight: 1,
                    opacity: 1,
                    fillOpacity: 0.8
                };

                latlng = L.latLng(lat, lon);
                dotting = L.circleMarker(latlng, markerOpt);
                grup.addLayer(dotting);
            }
        }
    }

    function addBounds(){
        mymap.fitBounds([
            [min_lat, min_lon],
            [max_lat, max_lon]
        ]);
        min_lat = 100, max_lat = -100, min_lon = 200, max_lon = -200;
    }
